import React, { useState, useEffect } from 'react';
import './TrackList.css';
import Track from '../Track/Track';

function TrackList(props, { searchResults }) {

    const onAdd1 = (tr) => {
        props.onAdd2(tr);
    }

    return (
        <div className="TrackList">
            {searchResults.map(
                searchResultObject => <Track searchResultObject={searchResultObject} onAdd={tr => onAdd1(tr)} />)}
        </div>
    )
}

export default TrackList;
